"use strict";$(document).ready(function(){var a=new Instascan.Scanner({video:document.getElementById("qr_scanner"),scanPeriod:5});a.addListener("scan",function(b){alert(b)});Instascan.Camera.getCameras().then(function(b){if(b.length>0){a.start(b[0]);$('[data-action="qr_scanner_change_front_camera"]').on("click",function(){a.start(b[0])});$('[data-action="qr_scanner_change_back_camera"]').on("click",function(){a.start(b[1])})}})});